define('plugins/demo/red/register', [
    'io.ox/core/extensions',
    'io.ox/portal/util',
    'less!plugins/demo/red/style'
], function (ext, util) {

    'use strict';

    // draw promotion above widgets
    ext.point('io.ox/portal/sections').extend({
        id: 'promotion',
        before: 'widgets',
        draw: function () {
            this.append(
                $('<div class="promotion">').append(
                    $('<h2>').text('Welcome message'),
                    $('<div>').text(
                        'Lorem ipsum dolor sit amet, consetetur sadipscing elitr, sed diam nonumy eirmod tempor invidunt.'
                    ),
                    $('<div class="buttons">').append(
                        $('<button type="button" class="btn btn-default">').text('Dismiss')
                    )
                )
            );

            this.one('tap', '.btn', function () {
                $(this).closest('.promotion').fadeOut(function () {
                    $(this).remove();
                });
            });
        }
    });

    // fake widget
    ext.point('io.ox/portal/sections').extend({
        id: 'my-thing',
        after: 'promotion',
        draw: function () {
            this.append(
                $('<div class="my-thing">').append(
                    $('<h2>').append(
                        $('<img class="logo" title="" alt="" src="data:image/png;base64,">'),
                        $('<span>').text(decodeURIComponent('My V%6fd%61f%6fn%65'))
                    ),
                    $('<div class="toggle">').show().append(
                        // row 1
                        $('<div class="data-row">').append(
                            $('<span class="pull-left">').text('Minutes'),
                            $('<span class="pull-right">').html('87 <small>of</small> 500 <small>left</small>')
                        ),
                        $('<div class="data-bar"><div class="data-bar-value" style="width: 83%"></div></div>'),
                        // row 2
                        $('<div class="data-row">').append(
                            $('<span class="pull-left">').text('SMS'),
                            $('<span class="pull-right">').html('317 <small>of</small> 600 <small>left</small>')
                        ),
                        $('<div class="data-bar"><div class="data-bar-value" style="width: 47%"></div></div>'),
                        // row 3
                        $('<div class="data-row">').append(
                            $('<span class="pull-left">').text('Data'),
                            $('<span class="pull-right">').html('1 <small>of</small> 500 <small>MB left</small>')
                        ),
                        $('<div class="data-bar"><div class="data-bar-value red" style="width: 99%"></div></div>'),
                        // note
                        $('<div class="data-row"><small>Updated 27/8/13 17.05pm</small></div>')
                    )
                )
                .on('tap', 'h2', function (e) {
                    var node = $(e.delegateTarget).find('.toggle');
                    if (node.is(':visible')) node.slideUp(); else node.slideDown();
                })
            );
        }
    });

    // fake ad
    ext.point('io.ox/portal/sections').extend({
        id: 'ad',
        after: 'my-thing',
        draw: function () {
            this.append(
                $('<div class="my-ad">').append(
                    $('<img alt="" src="data:image/jpeg;base64,">')
                )
                .on('click', function () {
                    /*eslint no-alert: 0*/
                    alert('Just an example');
                })
            );
        }
    });

    ext.point('io.ox/portal/widget-scaffold').disable('color');

    // force red color
    ext.point('io.ox/portal/widget-scaffold').extend({
        id: 'red-color',
        index: 400,
        draw: function () {
            util.setColor(this, 'red');
        }
    });
});
